      col = engineLoadCOL ( "modele/"..i..".col" )
      engineReplaceCOL ( col, v[1] )
    end
    if(fileExists("modele/"..v[2]..".txd"))then
      txd = engineLoadTXD ( "modele/"..v[2]..".txd" )
      engineImportTXD ( txd, v[1] )
