  id = id + 1
end

function hud()
  for i,object in ipairs(getElementsByType("object",resourceRoot)) do
    local px,py,pz = getElementPosition(object)
    local sx,sy = getScreenFromWorldPosition(px,py,pz,0.06)
    if sx and sy then
      dxDrawText(object.model,sx,sy,sx,sy,tocolor(100,255,100,200),1.5,"sans")
    end
  end
end
addEventHandler("onClientRender",root,hud)